#include"platform/ndsd.h"

#define DEVENTS_IMPLEMENTATION
#include"devents.h"

#define D_IMPLEMENTATION
#include"d.h"

#include"dplatform.h"

#include<stdio.h>
#include<string.h>
#include<nds.h>

#define LINES 5

#define DELAY 1000/60

#define TEXT_HEIGHT 10

/* This file tests the D_PumpEvents() function in
 *  ndsd.h.
 *
 * Right now, only touchscreen input works. It is
 *  treated as a mouse, firing mouse events.
 *
 * This test is slow, melonDS shows about 37 FPS.
 *  But it may be worse than that.
 */

int fontDataW = 270;
int fontDataH = 270;

extern char fontData[];

int currentLine = 0;
char strings[LINES][64];

/* Very basic printf.
 *
 * Note that the current line is the next line to
 *  write to, the line after the bottom line
 *  onscreen.
 */
int smallPrint(char * s, int a, int b, int c){

    sprintf(&strings[currentLine][0], s, a, b, c);

    currentLine++;
    currentLine = currentLine % LINES;

    return 0;
};

int main(){
    D_Surf * out = D_GetOutSurf(0, 0, 640, 480, "D_PumpEvents() test", 0);
    D_Surf * font = D_CreateSurfFrom(fontDataW, fontDataH, D_FindPixFormat(0xFF, 0xFF00, 0xFF0000, 0xFF000000, 32), fontData);
    int frameCount = 0;
    D_Point textPoint = {0, 0};
    D_Rect mouseRect = {0, 0, 20, 20};
    D_Event e;

    D_StartEvents();

    while(1){
        D_PumpEvents();

        while(D_GetEvent(&e) != -1){
            switch(e.type){
                case D_MOUSEDOWN:
                    smallPrint("dwn x %d y %d btn %d", e.mouse.x, e.mouse.y, e.mouse.button);
                    mouseRect.x = e.mouse.x;
                    mouseRect.y = e.mouse.y;
                    break;
                case D_MOUSEUP:
                    smallPrint("up x %d y %d btn %d", e.mouse.x, e.mouse.y, e.mouse.button);
                    mouseRect.x = e.mouse.x;
                    mouseRect.y = e.mouse.y;
                    break;
                case D_MOUSEMOVE:
                    smallPrint("mov x %d y %d btn %d", e.mouse.x, e.mouse.y, e.mouse.button);
                    mouseRect.x = e.mouse.x;
                    mouseRect.y = e.mouse.y;
                    break;
            };
        };


        mouseRect.w = 20;
        mouseRect.h = 20;

        //smallPrint("num: %d", frameCount, 0, 0);

        /*if(currentLine - 1 >= 0){
            D_PrintToSurf(out, font, &textPoint, 20, 0, &strings[0][currentLine - 1]);
        };*/

        D_FillRect(out, D_NULL, D_rgbaToFormat(out->format, 0, 0, 0, 255));
        //dmaFillWords(0, out->pix, SCREEN_WIDTH * SCREEN_HEIGHT * 2); //Hack optimisation, does the same as the above line at the same speed

        D_FillRect(out, &mouseRect, D_rgbaToFormat(out->format, 255, 100, 100, 255));

        /*textPoint.y = 0;
        D_PrintToSurf(out, font, &textPoint, 20, 0, &strings[0][0]);
        textPoint.y = 20;
        D_PrintToSurf(out, font, &textPoint, 20, 0, &strings[1][0]);
        textPoint.y = 40;
        D_PrintToSurf(out, font, &textPoint, 20, 0, &strings[2][0]);*/

        textPoint.y = SCREEN_HEIGHT - TEXT_HEIGHT;
        int i = 0;
        while(i < LINES){
            D_PrintToSurf(out, font, &textPoint, TEXT_HEIGHT, 0, &strings[(((currentLine - 1) - i) + LINES) % LINES][0]);
            textPoint.y = textPoint.y - TEXT_HEIGHT;
            i++;
        };

        D_FlipOutSurf(out);
        frameCount++;
        D_Delay(DELAY);
    };

    D_StopEvents();

    D_FreeOutSurf(out);
    out = D_NULL;

    return 0;
};






